import React, { Component } from 'react';
import {Row, Card} from 'antd';
import axios from 'axios';


const jobListUrl = 'https://jobtogo-504b3.firebaseio.com/job.json'
class jobs extends Component{

  constructor(){
    super()
    this.state = {
      jobList: '',
    }
  }
//?orderBy="employer"&equalTO=false
  componentDidMount = () =>{
    axios.get('https://jobtogo-504b3.firebaseio.com/job.json')
    .then( res => {
      this.setState({
        jobList: res.data
      })
      console.log(this.state.jobList)
    })
  }

  render(){
    const jobList = this.state.jobList;
    return(
      Object.keys(jobList).map( (v, i) => {
        return 
        (<Card
          title={v}
          extra={<a href="#">More</a>}
          style={{ width: 300 }}
        >
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>)
      })
    );
  }
}

export default jobs

